import "testing"

func runSample(t *testing.T, product []int, limit int, expect int) {
	res := maxInvestment(product, limit)

	if res != expect {
		t.Errorf("Sample expect %d, but got %d", expect, res)
	}
}

func TestSample1(t *testing.T) {
	product := []int{4, 5, 3}
	limit := 8
	expect := 26
	runSample(t, product, limit, expect)
}

